В «АТБ» осуществляют сбор помощи для территориальной обороны

С 24 числа ситуация по всей стране остается напряженной в связи с нападением России на Украину. В связи с этим во всех магазинах «АТБ» будет осуществляться сбор помощи для выдачи территориальной обороне города. 

Всем желающим поучаствовать в сборе потребностей по списку можно приносить помощь в любое время работы магазина. В случае чего, обращайтесь к охране.

Список нужных вещей для экипировки бойца:

бронежилеты, каски, балаклавы;
моноочки ночного виденья;
тактические очки;
тепловизоры;
разгрузки;
наколенники;
рюкзаки 60-80 литров;
перчатки мужские разных размеров;
термобелье, спальники;
перчатки тактические;
дальномеры оптические лазерные;
бинокли;
мешки, песок;
котелки личные;
аккумуляторы Enerlight для тепловизоров.

Список медицинских нужд:

катетеры внутреннего введения и Винфпон (разные размеры);
перфузоры;
тегадерм;
противоожоговые гели, повязки;
антибиотики в растворах, флаконах;
гемотран и его аналоги (ампулы), тивортин раствор (аналог);
зондовое питание;
турникеты CAT, Soft-Ti, SWAT;
бондажи, термоодеяла;
окклюзионные, противоожоговые повязки;
пневматические шины, носилки;
одеяла или носилки с подогревом;
портативные носилки, антикоагулянты;
жгуты эсмарха, бинты Мартенса;
перевязочные пакеты;
фитнес-резинки, гемостатичные бинты;
респираторы химзащиты;
налобные фонари;
одеяла, которые используют во время пожара (термозащитное одеяло).

За подробностями звоните по номерам: (050) 422-65-39, (093) 390-79-39, (056) 756-38-32.

