В Днепре увеличили финансирование теробороны

Во время 17-й внеочередной сессии горсовета было принято решение перераспределить городской бюджет. 

100 миллионов гривен перенаправлено из Департамента благоустройства и инфраструктуры на финансирование:

🔵Департамент благоустройства и инфраструктуры (ремонт дороги) - 5 млн гривен;
🟡Департамент транспортной инфраструктуры - 5 млн гривен;
🔵Департамент информационных технологий - 15 млн гривен; 
🟡 Департамент соцполитики - 5 млн гривен;
🔵 Департамент по местному самоуправлению, внутренней и информационной политике – 5 млн гривен;
🟡 Департамент общественного порядка и гражданской защиты – 65 млн гривен.

